// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract kevault {
    address public owner;
    mapping(address => bool) private courtOfficials;

    struct CaseFile {
        address uploader;
        string ipfsHash;
        string title;
        string dateOfJudgment;
        string caseNumber;
        string category;
        string judgeName;
        address[] linkedClients;  // Array of linked clients for the case file
        uint256 timestamp;
    }

    mapping(uint256 => CaseFile) public caseFiles;
    uint256 public totalCaseFiles;

    event FileUploaded(
        address indexed uploader,
        uint256 indexed fileId,
        string ipfsHash,
        string title,
        string dateOfJudgment,
        string caseNumber,
        string category,
        string judgeName,
        uint256 timestamp,
        address[] linkedClients
    );

    event ClientLinked(uint256 indexed fileId, address client);  // Event for linking clients

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    modifier onlyCourtOfficial() {
        require(courtOfficials[msg.sender], "Only court officials can upload files");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function addCourtOfficial(address _official) public onlyOwner {
        courtOfficials[_official] = true;
    }

    function removeCourtOfficial(address _official) public onlyOwner {
        courtOfficials[_official] = false;
    }

    function isCourtOfficial(address _official) public view returns (bool) {
        return courtOfficials[_official];
    }

    // Uploading a new file with an array of clients linked to it
    function uploadFile(
        string memory _ipfsHash,
        string memory _title,
        string memory _dateOfJudgment,
        string memory _caseNumber,
        string memory _category,
        string memory _judgeName,
        address[] memory _linkedClients
    ) public onlyCourtOfficial {
        require(bytes(_ipfsHash).length > 0, "IPFS hash is required");
        require(_linkedClients.length > 0, "At least one client must be linked");

        // Ensure client addresses are unique
        for (uint256 i = 0; i < _linkedClients.length; i++) {
            for (uint256 j = i + 1; j < _linkedClients.length; j++) {
                require(_linkedClients[i] != _linkedClients[j], "Client addresses must be unique");
            }
        }

        totalCaseFiles++;
        caseFiles[totalCaseFiles] = CaseFile({
            uploader: msg.sender,
            ipfsHash: _ipfsHash,
            title: _title,
            dateOfJudgment: _dateOfJudgment,
            caseNumber: _caseNumber,
            category: _category,
            judgeName: _judgeName,
            linkedClients: _linkedClients,
            timestamp: block.timestamp
        });

        emit FileUploaded(
            msg.sender,
            totalCaseFiles,
            _ipfsHash,
            _title,
            _dateOfJudgment,
            _caseNumber,
            _category,
            _judgeName,
            block.timestamp,
            _linkedClients
        );
    }

    // Link a new client to an existing case file
    function linkClient(uint256 _fileId, address _client) public onlyCourtOfficial {
        require(_fileId > 0 && _fileId <= totalCaseFiles, "Invalid file ID");

        // Check if the client is already linked
        for (uint256 i = 0; i < caseFiles[_fileId].linkedClients.length; i++) {
            require(caseFiles[_fileId].linkedClients[i] != _client, "Client already linked");
        }

        // Add client to the linked clients list
        caseFiles[_fileId].linkedClients.push(_client);
        emit ClientLinked(_fileId, _client);
    }

    // Retrieve case file details by file ID
    function getFile(uint256 _fileId) public view returns (
        address uploader,
        string memory ipfsHash,
        string memory title,
        string memory dateOfJudgment,
        string memory caseNumber,
        string memory category,
        string memory judgeName,
        address[] memory linkedClients,
        uint256 timestamp
    ) {
        CaseFile memory file = caseFiles[_fileId];
        return (
            file.uploader,
            file.ipfsHash,
            file.title,
            file.dateOfJudgment,
            file.caseNumber,
            file.category,
            file.judgeName,
            file.linkedClients,
            file.timestamp
        );
    }

    // Search case files by title
    function searchByTitle(string memory _title) public view returns (uint256[] memory) {
        uint256[] memory matchingFiles = new uint256[](totalCaseFiles);
        uint256 count = 0;

        for (uint256 fileId = 1; fileId <= totalCaseFiles; fileId++) {
            if (keccak256(bytes(caseFiles[fileId].title)) == keccak256(bytes(_title))) {
                matchingFiles[count] = fileId;
                count++;
            }
        }

        return sliceArray(matchingFiles, count);
    }

    // Helper function to slice arrays
    function sliceArray(uint256[] memory arr, uint256 count) internal pure returns (uint256[] memory) {
        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = arr[i];
        }
        return result;
    }
}

